import React from 'react';

const styles = {
  wrapper: {
    background: '#2e81f1',
    background: '-webkit-radial-gradient(circle, #599ff4, #2e81f1)',
    background: 'radial-gradient(circle, #599ff4, #2e81f1)',
    borderBottomRightRadius: 100,
    padding: 30,
    color: '#fff',
    minHeight: 200,
    display: 'flex'
  }
};

export default function HeaderWrapper(props) {
  return <div style={styles.wrapper}>{props.children}</div>;
}
